import React from 'react'
import magic from './Glasses.module.css'
import { Link } from 'react-router-dom'

const Glasses = () => {
    const [ingredients, setIngredients] = React.useState([])

    React.useEffect (() => {
        fetch(`https://www.thecocktaildb.com/api/json/v1/1/list.php?i=list`)
        .then(res => res.json())
        .then(data =>  setIngredients(data.drinks))}, [])

    return  (
        <div className={magic.wrapper}>
            <div className={magic.question}>
                <h4>Glasses</h4>
            </div>
            <div className={magic.itembox}>
                {ingredients.map(x => <Link to='/'>{ x.strIngredient1 }</Link>)}
            </div>
        </div>
    )
}

export default Glasses;
